import {BrowserRouter, Route, Routes} from 'react-router-dom';

//pages and components  
import Home from './pages/home';
import Navbar from '.components/Navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
      </BrowserRouter>  

    </div>
  );
}

export default App;
